INSERT INTO `blogs` (`id`, `user_id`, `title`, `image`, `description`) VALUES
(2, '1', 'Beneficials of Yoga ', '1457414374.jpg', '<p>"One of the far-reaching benefits of yoga is the uncanny sense of awareness that it develops in the practitioner of an impending health disorder or infection. This in turn enables the person to take pre-emptive corrective action"</p>\r\n<p>"Harness the power of yoga and gain the 3-fold Advantage of Fitness + Freedom from Stress + Happiness"</p>'),
(5, '12', 'Benefits of Running', '', '<p>â€œTogether with a healthy mind and diet, yoga can naturally produce \r\nglowing skin making one look younger, healthier and more beautiful.â€</p><p></p><p>Meditate twice a day, every day (even if itâ€™s just for 10 minutes). â€œThe more you do, the more you will radiate from withinâ€.</p>'),
(6, '12', 'Beautiful And Glowing Skin', '', '<p>Beautiful and glowing skin through yoga.These are the following points:-<br />&nbsp;<br />1. Pranayam<br />2. Tadasana or mountain pose<br />3. Uttanasana<br />4. Bharadvaja''s twist<br />5. Utkatasana<br />&nbsp;</p>');
