INSERT INTO `pages` (`id`, `title`, `key`, `content`, `order`, `position`, `is_rule`, `status`) VALUES
(3, 'About Us', 'about-us', '<table style="width: 75%; margin-left: auto; margin-right: auto;" cellspacing="25">\r\n<tbody>\r\n<tr style="height: 665px;">\r\n<td style="height: 665px; vertical-align: top;" colspan="2">\r\n<h3>About Us</h3>\r\n<h4>By Bryce Crage &ndash; Founder</h4>\r\n<p>&nbsp;</p>\r\n<p><strong>The goal of Suburb Run is to make running a little more interesting and adventurous, as well as discover the beautiful world around us. I want to help people become more active and live a healthier life, in their own time and at their own pace.</strong></p>\r\n<p><strong>&nbsp;&nbsp;</strong></p>\r\n<p><strong>Suburb Run came about as I never really identified myself as a runner and it wasn''t until I ran with a map for the first time that my eyes were opened. For me, it gave running a purpose. I could run much further than I ever would have thought possible and I got to discover so many new places I had never seen before. My goal wasn''t to run non-stop; it was to find the next &lsquo;control&rsquo;, the one just around the corner, and to do that as efficiently as possible. My running improved, as did my health.</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>It was simple &ndash; I was running with a reason.</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>I found that running in new locations kept me mentally focused; I never got lost because I always had a&nbsp;map. I realised that I could do this activity pretty much anywhere and I am hoping that I will be able to create courses in every country around the world. It would be wonderful to make Suburb Run a real global community so that wherever you are, you can discover new places and maintain your fitness.</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>It is an activity that everyone is able to participate in: children, adults, families, dog walkers, parents with prams, people in wheelchairs, novice runners to Olympic athletes, work colleagues, individuals or teams. Everyone... including you!</strong></p>\r\n<p><strong>&nbsp;&nbsp;</strong></p>\r\n<p><strong>Suburb Run is not a competition or a club (although you are able to make it as competitive as you wish!)&nbsp; You won''t find us&nbsp;at the start line; we are providing the content which enables you to get out and find an enjoyable course near you!</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>We are still fairly new so therefore we will grow and be continuously looking for ways to improve our courses and make Suburb Run enjoyable, so if you have any ideas and/or feedback please contact us using one of the links below. Similarly, if you need any help or have any questions please reach out to us.</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>I hope to see you run past me on a course someday soon!&nbsp;</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>Bryce Crage</strong></p>\r\n<p><strong>Founder</strong></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>', 1, 'top', 0, 1),
(12, 'How It Works', 'howitworks', '<table style="width: 75%; margin-left: auto; margin-right: auto;" cellspacing="25">\r\n<tbody>\r\n<tr>\r\n<td style="vertical-align: top;" colspan="3">\r\n<h3><strong>How It Works</strong></h3>\r\n<p><strong><u>In 3 Simple Steps</u></strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style="width: 33%; vertical-align: top; text-align: center;">\r\n<h1>1</h1>\r\n</td>\r\n<td style="width: 33%; vertical-align: top; text-align: center;">\r\n<h1>2</h1>\r\n</td>\r\n<td style="width: 33%; vertical-align: top; text-align: center;">\r\n<h1>3</h1>\r\n<p>&nbsp;</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style="width: 33%; vertical-align: top; text-align: center;"><strong>Unlock a course and download the course map</strong></td>\r\n<td style="width: 33%; vertical-align: top; text-align: center;"><strong>Get to the course start, start your preferred GPS device and get moving!</strong></td>\r\n<td style="width: 33%; vertical-align: top; text-align: center;"><strong>After your activity upload your GPS to our website and see how you went, compare against your previous efforts, friends and others.</strong></td>\r\n</tr>\r\n<tr>\r\n<td style="vertical-align: top;" colspan="3">\r\n<p>&nbsp;</p>\r\n<h3><strong>Frequently Asked Questions</strong></h3>\r\n<p>&nbsp;</p>\r\n<p><strong>How much does Suburb Run cost?</strong></p>\r\n<ul style="list-style-type: square; padding-left: 30px;">\r\n<li><strong>You can use Suburb Run for free - when you register an account you are given 3 free credits. Each credit will unlock a course for you. Further there are a number of free courses which are available for you to use.&nbsp;</strong></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>What are course passes&nbsp;and why would I get them?</strong></p>\r\n<ul style="list-style-type: square; padding-left: 30px;">\r\n<li><strong>Course passes&nbsp;allow you to unlock courses - If you enjoy trying out new courses you can purchase more course passes&nbsp;to unlock more courses. Once you unlock a course you will&nbsp;have access to it once it is a current course or an expired course.</strong></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>You have a subscription option - what is that for?</strong></p>\r\n<ul style="list-style-type: square; padding-left: 30px;">\r\n<li><strong>Subscription is best for people who run a lot and want to unlock a lot of courses - we want to make it as cheap as possible for you to access additional content from our site. Subscription users will be able to unlock an unlimited number of courses that would be active during their subscription period. Course passes will however be reuqired for maps predating the subscription period start and after its end date (unless you extend the subscription).</strong></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>Do you store my credit card information?</strong></p>\r\n<ul style="list-style-type: square; padding-left: 30px;">\r\n<li><strong>No - we use Paypal as a payment gateway - they securely manage the transaction throughout the process.<br /> <br /> </strong></li>\r\n</ul>\r\n<p><strong>I have unlocked a course but I can&rsquo;t see the control points! help?</strong></p>\r\n<ul style="list-style-type: square; padding-left: 30px;">\r\n<li><strong>The course is likely to be an upcoming course - this means it has not been released in full yet - the course''s controls will become available to you when the course is current.</strong></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>What is a GPS enabled device?</strong></p>\r\n<ul style="list-style-type: square; padding-left: 30px;">\r\n<li><strong>There are a number of GPS enabled devices on the market but the most common are watches and phones. Almost all smartphones are capable of acting as a GPS enabled device with the use of an app.</strong></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>Why don''t you have an App for us to use?</strong></p>\r\n<ul>\r\n<li><strong>It is on its way soon! I promise!</strong></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>I have run my course and have a GPS recording of it what next?</strong></p>\r\n<ul style="list-style-type: square; padding-left: 30px;">\r\n<li><strong>Download&nbsp;the GPX file associated with your GPS trace from whichever provider it gets saved to and upload it against the course you ran - We will handle the rest.</strong>&nbsp;</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>I definitely ran through that control!</strong></p>\r\n<ul>\r\n<li><strong>We do our very best to make sure we capture your activity correctly - have a look at your trace to see if you went through the control circle or not. If you did and it&rsquo;s not showing as if you did, feel free to contact us and we will look into it.</strong></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>A control was unreachable - how is that fair?!</strong></p>\r\n<ul style="list-style-type: square; padding-left: 30px;">\r\n<li><strong>It&rsquo;s not - we agree! Despite our best efforts when setting courses, what we can see on the maps doesn&rsquo;t always match reality on the ground - sorry we wish it did. However if you let us know, we will fix it so that others don''t run into the same problem.</strong></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>Why did you want my location in my profile?</strong></p>\r\n<ul style="list-style-type: square; padding-left: 30px;">\r\n<li><strong>This allows us to show you the courses nearest to you - it&rsquo;s not mandatory and you can put in any location you would like including suburb level.&nbsp;</strong></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>I still have questions!</strong></p>\r\n<ul style="list-style-type: square; padding-left: 30px;">\r\n<li><strong>You''re inquisitive - that''s great, contact us using the contact us button and we will answer any other questions you may have.</strong></li>\r\n</ul>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>', 2, 'top', 0, 1),
(13, 'Scatter Course Rules', 'scatter_rules', '<div style="width: 75%; margin-left: auto; margin-right: auto;">\r\n<h3>Scatter&nbsp;Course Rules and Terms</h3>\r\n<p>Last updated: 7 June 2016</p>\r\n<p>&nbsp;</p>\r\n<h4>Course Rules</h4>\r\n<ul style="list-style-type: square; padding-left: 30px;">\r\n<li><strong>You can&nbsp;visit&nbsp;the course controls in any order.</strong></li>\r\n<li><strong>You must visit the required minimum number of unique controls (or greater) to correctly complete the course.</strong></li>\r\n<li><strong>You will only be credited for visiting a control once - visiting a control&nbsp;multiple times has no benefit in completing the objective.</strong></li>\r\n<li><strong>There is no time limit.</strong></li>\r\n<li><strong>There are no penalties.</strong></li>\r\n<li><strong>You may run off map however it is not recommended</strong></li>\r\n<li><strong>You must pass the centre of the control +/- a few metres for the control to be considered collected.&nbsp;</strong></li>\r\n</ul>\r\n<h4>&nbsp;</h4>\r\n<h4>General Information</h4>\r\n<ul style="list-style-type: square; padding-left: 30px;">\r\n<li><strong>Using this course map does NOT grant you permission to enter private property.</strong></li>\r\n<li><strong>You must obey all normal laws and road rules, holding this course map gives you no special rights in this regard.</strong></li>\r\n<li><strong>This is NOT a race or a competition.</strong></li>\r\n<li><strong>The map information is based on the best available information via Google maps and Suburb Run cannot be held accountable for any map inaccuracies/errors/omissions.</strong></li>\r\n<li><strong>If a control is in an unreachable or dangerous location do not attempt to reach it, please report as soon as practical via the website.</strong></li>\r\n<li><strong>Please consider informing someone of your course location and your expected completion time before undertaking a course.</strong></li>\r\n</ul>\r\n<h4>&nbsp;</h4>\r\n<h4>Terms</h4>\r\n(in addition to site terms)\r\n<ul style="list-style-type: square; padding-left: 30px;">\r\n<li><strong>You agree that any activity that you undertake in connection with Suburb Run carries inherent risks and that you accept all known and unknown risks associated with the activity even if the risk is caused by the action, inaction or negligence of Suburb Run or of others.</strong></li>\r\n<li><strong>You agree that it is your responsibility to ensure that you are fit enough to undertake this activity. You should consult your general practitioner before taking up a new physical sport.</strong></li>\r\n<li><strong>Children must be accompanied by an adult at all times.</strong></li>\r\n<li><strong>You agree that when undertaking activities in connection with Suburb Run you do so without express permission from the relevant council/governing authorities and do so at your own risk.</strong></li>\r\n<li><strong>You are not to reproduce or distribute the course map to others without the express permission of Suburb Run.</strong></li>\r\n<li><strong>Suburb Run reserves the right to change its rules and terms.</strong></li>\r\n</ul>\r\n</div>\r\n<p>&nbsp;</p>', 1, 'bottom', 1, 1),
(14, 'Terms', 'terms', '<p>Terms Pagedsfdfsdf</p>', 0, '', 0, 1),
(15, 'Privacy Policy', 'privacy', '<p>Coming Soon</p>', 0, '', 0, 1),
(16, 'Score Course Rules', 'score_rules', '<div style="width: 75%; margin-left: auto; margin-right: auto;">\r\n<h3>Score&nbsp;Course Rules and Terms</h3>\r\n<p>Last updated: 7 June 2016</p>\r\n<p>&nbsp;</p>\r\n<h4>Course Rules</h4>\r\n<ul style="list-style-type: square; padding-left: 30px;">\r\n<li><strong>You can&nbsp;visit&nbsp;the course controls in any order.</strong></li>\r\n<li><strong>You will only be credited the score of a control once - visiting a control&nbsp;multiple times has no benefit.</strong></li>\r\n<li><strong>There is no minimum number of controls that you must visit.</strong></li>\r\n<li><strong>There is a strict time limit.</strong></li>\r\n<li><strong>There are penalties for finishing after the time limit</strong>\r\n<ul style="list-style-type: disc; padding-left: 30px;">\r\n<li><strong>You will lose 10 points per 1s - 60s block (e.g 1s - 60s = 10 points, 61s - 120s = 20 points, etc.)</strong></li>\r\n<li><strong>At 10 minutes late (or greater) you will lose all your points</strong></li>\r\n<li><strong>Your points will never go below 0</strong></li>\r\n</ul>\r\n</li>\r\n<li><strong>You may run off map however it is not recommended.</strong></li>\r\n<li><strong>You must pass the centre of the control +/- a few metres for the control to be considered collected.&nbsp;</strong></li>\r\n</ul>\r\n<h4>&nbsp;</h4>\r\n<h4>General Information</h4>\r\n<ul style="list-style-type: square; padding-left: 30px;">\r\n<li><strong>Using this course map does NOT grant you permission to enter private property.</strong></li>\r\n<li><strong>You must obey all normal laws and road rules, holding this course map gives you no special rights in this regard.</strong></li>\r\n<li><strong>This is NOT a race or a competition.</strong></li>\r\n<li><strong>The map information is based on the best available information via Google maps and Suburb Run cannot be held accountable for any map inaccuracies/errors/omissions.</strong></li>\r\n<li><strong>If a control is in an unreachable or dangerous location do not attempt to reach it, please report as soon as practical via the website.</strong></li>\r\n<li><strong>Please consider informing someone of your course location and your expected completion time before undertaking a course.</strong></li>\r\n</ul>\r\n<h4>&nbsp;</h4>\r\n<h4>Terms</h4>\r\n(in addition to site terms)\r\n<ul style="list-style-type: square; padding-left: 30px;">\r\n<li><strong>You agree that any activity that you undertake in connection with Suburb Run carries inherent risks and that you accept all known and unknown risks associated with the activity even if the risk is caused by the action, inaction or negligence of Suburb Run or of others.</strong></li>\r\n<li><strong>You agree that it is your responsibility to ensure that you are fit enough to undertake this activity. You should consult your general practitioner before taking up a new physical sport.</strong></li>\r\n<li><strong>Children must be accompanied by an adult at all times.</strong></li>\r\n<li><strong>You agree that when undertaking activities in connection with Suburb Run you do so without express permission from the relevant council/governing authorities and do so at your own risk.</strong></li>\r\n<li><strong>You are not to reproduce or distribute the course map to others without the express permission of Suburb Run.</strong></li>\r\n<li><strong>Suburb Run reserves the right to change its rules and terms.</strong></li>\r\n</ul>\r\n</div>\r\n<p>&nbsp;</p>', 0, '', 1, 0),
(17, 'Line Course Rules', 'line_rules', '<div style="width: 75%; margin-left: auto; margin-right: auto;">\r\n<h3>Line Course Rules and Terms</h3>\r\n<p>Last updated: 7 June 2016</p>\r\n<p>&nbsp;</p>\r\n<h4>Course Rules</h4>\r\n<ul style="list-style-type: square; padding-left: 30px;">\r\n<li><strong>You must complete the course in numerical order.</strong>\r\n<ul style="list-style-type: disc; padding-left: 30px;">\r\n<li><strong>If you go to a control out of order you may return to the point in which you made the mistake and continue. E.G: S-1-2-4-3-4-5-F is valid so long as you complete all controls and have numerical sequence somewhere within your collection order.</strong></li>\r\n</ul>\r\n</li>\r\n<li><strong>There is no time limit.</strong></li>\r\n<li><strong>There are no penalties.</strong></li>\r\n<li><strong>You may run off map however it is not recommended</strong></li>\r\n<li><strong>You must pass the centre of the control +/- a few metres for the control to be considered collected.&nbsp;</strong></li>\r\n</ul>\r\n<h4>&nbsp;</h4>\r\n<h4>General Information</h4>\r\n<ul style="list-style-type: square; padding-left: 30px;">\r\n<li><strong>Using this course map does NOT grant you permission to enter private property.</strong></li>\r\n<li><strong>You must obey all normal laws and road rules, holding this course map gives you no special rights in this regard.</strong></li>\r\n<li><strong>This is NOT a race or a competition.</strong></li>\r\n<li><strong>The map information is based on the best available information via Google maps and Suburb Run cannot be held accountable for any map inaccuracies/errors/omissions.</strong></li>\r\n<li><strong>If a control is in an unreachable or dangerous location do not attempt to reach it, please report as soon as practical via the website.</strong></li>\r\n<li><strong>Please consider informing someone of your course location and your expected completion time before undertaking a course.</strong></li>\r\n</ul>\r\n<h4>&nbsp;</h4>\r\n<h4>Terms</h4>\r\n(in addition to site terms)\r\n<ul style="list-style-type: square; padding-left: 30px;">\r\n<li><strong>You agree that any activity that you undertake in connection with Suburb Run carries inherent risks and that you accept all known and unknown risks associated with the activity even if the risk is caused by the action, inaction or negligence of Suburb Run or of others.</strong></li>\r\n<li><strong>You agree that it is your responsibility to ensure that you are fit enough to undertake this activity. You should consult your general practitioner before taking up a new physical sport.</strong></li>\r\n<li><strong>Children must be accompanied by an adult at all times.</strong></li>\r\n<li><strong>You agree that when undertaking activities in connection with Suburb Run you do so without express permission from the relevant council/governing authorities and do so at your own risk.</strong></li>\r\n<li><strong>You are not to reproduce or distribute the course map to others without the express permission of Suburb Run.</strong></li>\r\n<li><strong>Suburb Run reserves the right to change its rules and terms.</strong></li>\r\n</ul>\r\n</div>\r\n<p>&nbsp;</p>', 0, '', 1, 0);
